import React, {Component} from 'react'
import { withRouter } from 'react-router-dom';


class ArticleList extends Component {
    constructor(props){
        super(props)
        this.state = {};
    }


    render() {
      const { 
        history: {
            location: {
              pathname
            }
        }
      } = this.props;

      const split = pathname.split('/')[1];
      return (
          <div>{split}</div>
      )
  }
}

export default withRouter(ArticleList);
